""" This module hosts the main controller class """
from flask import request

from app.database.models import (LongrichUserModel, PostModel, ProductModel,
                                 TagModel)


class MainController:
    def get_product(self,param):
        p = PostModel.find_by_id(int(param))

        if p:
            x = {}

            x['log'] = p.json()
            post = p.get_post()
            post.get_stats()

            x['post'] = post.json()
            x['post']['tags'] = post.get_tags()

            post.set_visitor(request.remote_addr)
            
            return {"error":0,"content":x}
            
        else:
            return {"error": 1 }

    def get_placement(self,name):
        users = LongrichUserModel.find_by_name(name)

        return {
            "error":0,
            "content":[x.json() for x in users]
        }

    @staticmethod
    def get_products(offset):
        posts = PostModel.get_posts_by_offset(offset)
        tags = []

        for p in posts:
            post = p.get_post()
            ts = post.tags

            for t in ts:
                if t.tagId not in tags:
                    tags.append(t.tagId)

        tagsFound = TagModel.get_all_tags(tags)
        content = []

        for p in posts:
            x = {}
            post = p.get_post()

            x['log'] = p.json()
            x['post'] = post.json()
            x['post']['body'] = ""

            ts = post.tags
            xtags = []

            for t in ts:
                for y in tagsFound:
                    if t.tagId == y.id:
                        xtags.append(y.json())
            
            x['tags'] = xtags

            content.append(x)


        return {"error":0,"content":content}


    def product_reaction(self, param, param2):
        try:
            if int(param2) <= 2:
                comment = ProductModel.find_by_id(int(param))

                if comment:
                    comment.set_reaction(request.remote_addr, int(param2))
                    return {"error": 0}
                else:
                    return {"error": 3}
            else:
                return {"error": 2}
        except:
            return {"error": 1}


    def get_form(self):
        return {
            "error":0,
            "content":'data:image/png;base64,'
        }
